! FDMX and subroutines are written by J. Bourke and Ch. Chantler, University of Melbourne, Australia

! They are included in the FDMNES package from 2015  
! Some modifications by YJ to avoid NAN in Impf output (2016/09/06)

subroutine fdmx(fdmnes_inp,nomfich,cm2g,nobg,nohole,nodwfact,noimfp,Gamma_hole,Gamma_hole_imp,E_cut_imp,E_cut_man, &
    imfp_inp, imfp_infile, elf_inp, elf_infile, dwfactor_inp, dwfactor, tdebye_inp, debyetemp, tmeas_inp, tmeas, Energphot, &
    expntl, expntlA, expntlB, victoreen, victA, victB, mermrank, ngroup, posn, itype, ntype, numat)

  integer, parameter:: db = selected_real_kind(15)

  integer, dimension(ngroup):: itype
  integer, dimension(0:ntype):: numat
  integer:: atomtypes(1:92,1:2), mermrank, scelfimfpdim, lines, linesconv, econvmin, &
    absorbeur, imark, Z, maxpoint, ninputs, natoms, Znn, Ztemp, &
    natomstot, ngroup, ntype

  character(len=1024):: scratch, fnames(100), inpname, outname
  character(len=132):: fdmnes_inp, nomfich, imfp_infile, elf_infile

  logical nodwfact, noimfp, Energphot, expntl, victoreen, bgedges, inckedge, cm2g, &
    nobg, nohole, Gamma_hole_imp, E_cut_man, imfp_inp, elf_inp, dwfactor_inp, &
    tdebye_inp, tmeas_inp, imfpdone, molinp, elfinexists
  real(kind=db):: m_yj
  real(kind=db), dimension(3,ngroup):: posn
  real(kind=db):: x1, x6, x7, E_cut_imp, dwfactor, tmeas, debyetemp, expntlA, expntlB, victA, victB
  real(kind=db), dimension(10):: Gamma_hole
  real(kind=db):: scelfimfp(1024,2)

  real:: E(8000), mu0(8000), atom(8000), spline(8000), mu(8000), mult(-8000:8000), &
    Einit(8000), mu0init(8000), smalldist, disttemp, spacing, a, pi, eu, sigmaparam, &
    BG(8000), mu1(8000), Econv(8000), convval(8000), convvalue, xpostemp, &
    ypostemp, zpostemp, xpostemp1, ypostemp1, zpostemp1, Efermi, hwidth, xpos, ypos, &
    zpos, avec, bvec, cvec, alphang, betang, gamang, xabspos, yabspos, zabspos, &
    masstotal, imfpvalue, tdeb, tmeasured, atommass, imfpval(8000), Nv, rho, masstot, &
    egap, nvpart, Navag, imfpvaltab, cm2gtombarn(1:92), edgepos, ffastbg, masstotaltemp, &
    Nvtemp, voltemp, rscratch, mbarntocm2g, background(8000), imfpm, imfpb, &
    Aint, Bint, Cint, Dint, ddone, ddtwo, bgpart

Navag = 6.022141E+23
pi = 3.14159
eu = 2.718282
rydb = 13.60569
molinp = .false.
hwidth = -1.0
scelfimfp = 0.0
if (Gamma_hole_imp) then
   hwidth = Gamma_hole(1)*rydb
end if
bgedges = .true.
if (nobg) then
   bgedges = .false.
end if
Efermi = 2.0
if (E_cut_man) then
   Efermi = E_cut_imp
end if
if (dwfactor_inp) then
   sigmaparam = dwfactor*1.0E-10
end if
if (tdebye_inp) then
   tdeb = debyetemp
end if
tmeasured = 298
if (tmeas_inp) then
   tmeasured = tmeas
end if

ninputs = 1

fnames(1) = fdmnes_inp

do ij=1,ninputs
! ESTABLISH DATA
   write(inpname,*) trim(nomfich), ".txt"
! Find crystal info
   absorbeur = 1
   open(unit=203,file=trim(fnames(ij)))
   do jk=1,1000
      read(203,*,end=20) scratch
      if (trim(scratch) .EQ. "Absorbeur") then
         read(203,*) absorbeur
         exit
      end if
   end do
   20 close(203)
 
   open(unit=203,file=trim(fnames(ij)))

   do jk = 1,1000
     read(203,*) scratch
     if( .not. ( trim(scratch) .EQ. "Crystal" .OR. trim(scratch) .EQ. "crystal" .or. &
                 trim(scratch) .EQ. "Molecule" .OR. trim(scratch) .EQ. "molecule" ) ) cycle

     if (trim(scratch) .EQ. "Molecule" .OR. trim(scratch) .EQ. "molecule") molinp = .true.

     kji = 0      
     do i = 1,1000
       n = nnombre(203,132)
       read(203,*)
       if( n == 0 ) cycle
       kji = kji + 1
       if( kji == absorbeur + 1 ) then
         backspace(203)
         exit
       endif 
     end do
     read(203,*) Z, xabspos, yabspos, zabspos
     exit
   end do
   
   close(203)

   if (Z .LT. 21) then
      STOP "Z for absorbing atom is too low (required Z>=21)"
   end if

   do jj=1,ngroup
      itype(jj) = numat(abs(itype(jj)))
   end do

   natoms = 0
   masstotal = 0
   natomstot = ngroup
   Nv = 0
   cm2gtombarn(1:92) = 0.0
   atomtypes(1:92,1:2) = 0
   do jk=1,ngroup
      if (itype(jk) .EQ. Z) then
        natoms = natoms + 1
      endif
      call amasses(itype(jk),atommass)
      masstotal = masstotal + atommass
      call amasses(itype(jk)+118,nvpart)
      Nv = Nv + nvpart

      do iii=1,92
         if (atomtypes(iii,2) .EQ. 0) then
            atomtypes(iii,2) = itype(jk)
            atomtypes(iii,1) = 1
            cm2gtombarn(iii) = (atommass/Navag)*1.0E+18
            EXIT
         elseif (atomtypes(iii,2) .EQ. itype(jk)) then
            atomtypes(iii,1) = atomtypes(iii,1) + 1
            cm2gtombarn(iii) = cm2gtombarn(iii) + (atommass/Navag)*1.0E+18
            EXIT
         end if
      end do
   end do

   open(unit=203,file=trim(fnames(ij)))
   do jk=1,1000
      read(203,*) scratch
      if (trim(scratch) .EQ. "Crystal" .OR. trim(scratch) .EQ. "crystal") then
         read(203,*) avec, bvec, cvec, alphang, betang, gamang, scratch
         EXIT
      elseif (trim(scratch) .EQ. "Molecule" .OR. trim(scratch) .EQ. "molecule") then
         read(203,*) avec, bvec, cvec, alphang, betang, gamang, scratch
         EXIT
      end if
   end do
   close(203)

   smalldist = 10000.0
   do kji=1,ngroup
      Ztemp = itype(kji)
      xpostemp = posn(1,kji)
      ypostemp = posn(2,kji)
      zpostemp = posn(3,kji)
      xpostemp1 = (xpostemp - xabspos) * avec
      ypostemp1 = (ypostemp - yabspos) * bvec
      zpostemp1 = (zpostemp - zabspos) * cvec
      xpostemp = xpostemp1*SIN(gamang*pi/180)
      xpostemp = xpostemp + ypostemp1*COS(alphang*pi/180)*SIN(betang*pi/180)
      xpostemp = xpostemp + zpostemp1*COS(betang*pi/180)
      ypostemp = xpostemp1*COS(gamang*pi/180) + ypostemp1*SIN(alphang*pi/180)
      zpostemp = ypostemp1*COS(alphang*pi/180)*SIN(betang*pi/180) + zpostemp1*SIN(betang*pi/180)
      disttemp = (xpostemp**2 + ypostemp**2 + zpostemp**2)**0.5
      if (disttemp .LT. smalldist .AND. disttemp .GT. 0.0001) then
         smalldist = disttemp
         xpos = xpostemp
         ypos = ypostemp - yabspos
         zpos = zpostemp - zabspos
         Znn = Ztemp
      end if
   end do

! LIFETIME BROADENING
   if (hwidth .EQ. -1.0) then
      call holewidth(Z,hwidth)
   end if
      x1 = hwidth
   if (nohole .OR. hwidth .LE. 0.0) then
      x1 = 0.001
   end if

!  INPUTS FOR THERMAL PARAMETER
   vol = 1 + 2*COS(alphang*pi/180)*COS(betang*pi/180)*COS(gamang*pi/180)
   vol = vol - (COS(alphang*pi/180)**2) - (COS(betang*pi/180)**2) - (COS(gamang*pi/180)**2)
   vol = vol**0.5
   vol = vol*avec*bvec*cvec*1.0E-30
   vol = vol/natomstot
   if (.NOT. dwfactor_inp .AND. .NOT. nodwfact) then
      am = masstotal/natomstot
      if (.NOT. tdebye_inp) then
         call tdebye(Znn,tdeb)
      end if
      xpos = ((xpos**2)**0.5)*1.0E-10
      ypos = ((ypos**2)**0.5)*1.0E-10
      zpos = ((zpos**2)**0.5)*1.0E-10
      if (tdeb .EQ. 0.0) then
         sigmaparam = 0.0
      else
         sigmaparam = sigmax(xpos,ypos,zpos,tdeb,tmeasured,am,vol)
         sigmaparam = (sigmaparam**0.5)*(2.0**0.5)
      end if
   end if
   if (nodwfact) then
      sigmaparam = 0.0
   end if

! MAIN INPUT FILE
   open(unit=102,file=trim(adjustl(inpname)))
   lines = 0
!   read(102,*) scratch, edgepos
   read(102,*) edgepos
   edgepos = edgepos/1000
   write(*,904) edgepos
904 format(" Edge Position is:", F7.3, " keV")
   if (nodwfact) then
      write(*,*) "Debye-Waller damping disabled"
   else
      write(*,903) sigmaparam*1.0E10
903 format(" Effective Debye-Waller Factor is:",F9.5," A")
   end if
   if (nohole) then
      write(*,*) "Hole width is disabled"
   else
      write(*,905) x1
905 format (" Hole width is:", F6.2, " eV")
   end if
   read(102,*) scratch
   do i=1,1800
      read(102,*,end=10) E(i), mu0(i)
      if (Energphot) then
         E(i) = E(i) - edgepos*1000
      end if
      lines = lines + 1
   end do
   10 close(102)
   Einit = E
   mu0init = mu0
   spacing = 0.5

! Set up FDMNES solid data on nice grid (cubic interp)
   E(1) = INT(E(1))
   maxpoint = INT(((Einit(lines)-Einit(1))/spacing)+1)

   do i=2,maxpoint
      E(i) = E(1) + spacing*(i-1)
   end do

   do i=1,maxpoint
      do j=1,lines
         if (E(i) .GE. Einit(j)) then
            imark = j
         end if
      end do
      if (E(i) .LT. Efermi) then
         mu0(i) = 0.0
      else
         ddone = 0
         ddtwo = 0
         if (imark .GT. 1) then
            ddone = (mu0init(imark+1)-mu0init(imark))/(Einit(imark+1)-Einit(imark))
            ddone = ddone - (mu0init(imark)-mu0init(imark-1))/(Einit(imark)-Einit(imark-1))
            ddone = 2*ddone/((Einit(imark+1)+Einit(imark)) - (Einit(imark)+Einit(imark-1)))
         end if
         if (imark .LT. lines-1) then
            ddtwo = (mu0init(imark+2)-mu0init(imark+1))/(Einit(imark+2)-Einit(imark+1))
            ddtwo = ddone - (mu0init(imark+1)-mu0init(imark))/(Einit(imark+1)-Einit(imark))
            ddtwo = 2*ddone/((Einit(imark+2)+Einit(imark+1)) - (Einit(imark+1)+Einit(imark)))
         end if
         Aint = (Einit(imark+1) - E(i))/(Einit(imark+1) - Einit(imark))
         Bint = (E(i) - Einit(imark))/(Einit(imark+1) - Einit(imark))
         Cint = (Aint**3 - Aint)/6.0
         Cint = Cint*(Einit(imark+1) - Einit(imark))**2
         Dint = (Bint**3 - Bint)/6.0
         Dint = Dint*(Einit(imark+1) - Einit(imark))**2
         mu0(i) = Aint*mu0init(imark) + Bint*mu0init(imark+1) + Cint*ddone + Dint*ddtwo
      end if
   end do

! Determine atomic background function
   do i=1,maxpoint
      if (E(i) .LT. Efermi) then
         atom(i) = 0.0
      else
         call atombg(E(i),Z,atom(i))
         atom(i) = atom(i)*natoms
      end if
   end do

! Generate uncolvolved spline (with exponential/victoreen)
   do i=1,maxpoint
      spline(i) = 0
   end do
   if (expntl) then
      x6 = expntlA
      x7 = expntlB
      do i=1,maxpoint
         if (E(i) .GE. 2.0 .AND. x7 .NE. 0) then
            spline(i) = spline(i) + x6*exp(-1.0*(E(i)-1.95)/x7)
         end if
      end do
   end if
   if (victoreen) then
      x6 = victA
      x7 = victB
      do i=1,maxpoint
         if (E(i) .GE. 2.0) then
            spline(i) = spline(i) + x6*((edgepos*1000+1.95)/(E(i)+edgepos*1000))**3
            spline(i) = spline(i) + x7*((edgepos*1000+1.95)/(E(i)+edgepos*1000))**4
         end if
      end do
   end if
   do i=1,maxpoint
      spline(i) = atom(i)*(1 + spline(i))
   end do

! Convolve spline to generate new atomic BG
   do i=1, maxpoint
      a = (x1)/2
      BG(i) = 0
      do k=-800, 800
         mult(k) = (atan(((2*(k)+1)*spacing/2)/a)-atan(((2*(k)-1)*spacing/2)/a))/pi
         if (i+k .GT. 1 .AND. i+k .LT. maxpoint) then
            BG(i) = BG(i) + spline(i+k)*mult(k)
         else if (i+k .EQ. 1) then
            BG(i) = BG(i) + spline(i+k)*(atan(((2*(k)+1)*spacing/2)/a) + pi/2)/pi
         else if (i+k .EQ. maxpoint) then
            BG(i) = BG(i) + spline(i+k)*(pi/2 - atan(((2*(k)-1)*spacing/2)/a))/pi
         end if
      end do
      spline(i) = BG(i)
   end do

! Convolve atom to find old atomic BG
   do i=1, maxpoint
      a = (x1)/2
      BG(i) = 0
      do k=-800, 800
         mult(k) = (atan(((2*(k)+1)*spacing/2)/a)-atan(((2*(k)-1)*spacing/2)/a))/pi
         if (i+k .GT. 1 .AND. i+k .LT. maxpoint) then
            BG(i) = BG(i) + atom(i+k)*mult(k)
         else if (i+k .EQ. 1) then
            BG(i) = BG(i) + atom(i+k)*(atan(((2*(k)+1)*spacing/2)/a) + pi/2)/pi
         else if (i+k .EQ. maxpoint) then
            BG(i) = BG(i) + atom(i+k)*(pi/2 - atan(((2*(k)-1)*spacing/2)/a))/pi
         end if
      end do
      atom(i) = BG(i)
   end do

! Convolve mu by hole width
   do i=1, maxpoint
      a = (x1)/2
      mu1(i) = 0
      do k=-800, 800
         mult(k) = (atan(((2*(k)+1)*spacing/2)/a)-atan(((2*(k)-1)*spacing/2)/a))/pi
         if (i+k .GT. 1 .AND. i+k .LT. maxpoint) then
            mu1(i) = mu1(i) + mu0(i+k)*mult(k)
         else if (i+k .EQ. 1) then
            mu1(i) = mu1(i) + mu0(i+k)*(atan(((2*(k)+1)*spacing/2)/a) + pi/2)/pi
         else if (i+k .EQ. maxpoint) then
            mu1(i) = mu1(i) + mu0(i+k)*(pi/2 - atan(((2*(k)-1)*spacing/2)/a))/pi
         end if
      end do
   end do

! Convolve mu by width due to IMFP

! YJ  Not initialized
  scelfimfpdim = 1
! YJ  
  
! Find IMFP if ELFin is used
   if (elf_inp .AND. .NOT. noimfp) then
      INQUIRE(file=trim(adjustl(elf_infile)),exist=elfinexists)
      if (.NOT. elfinexists) then
         write(*,*) "WARNING: ELFin file not found - using default IMFP values"
      else
         call scelf(elf_infile,mermrank,scelfimfp,inpname,Efermi)
         do i=1,1024
            if (scelfimfp(i,1) .NE. 0) then
               scelfimfpdim = i
            else
               EXIT
            end if
         end do
      endif
   endif

! DEFINE OUTPUT FILE
   write(outname,*) inpname(1:len(trim(inpname))-4), "_FDMX.txt"
   open(unit=103,file=trim(adjustl(outname)))
   if (cm2g) then
      write(103,*) "    #E         mu(fdmx)      mu(fdmnes)       atom        background        imfp"
      write(*,*) "    E         mu(fdmx)      mu(fdmnes)       atom        background        imfp"
   else
      write(103,*) "    #E          mu          atom          background          imfp"
      write(*,*) "    E          mu          atom          background          imfp"
   end if

! Main IMFPconv
   do i=1, maxpoint

! YJ line commented because fittype not given
! Power fit
!      if (fittype .EQ. 1) then
!          a = x1/2 + (x2*E(i) + x3*E(i)**2 + x4*E(i)**3 + x5*E(i)**4)/2
!      end if
! Arctan fit
!      if (fittype .EQ. 2) then
!         lite = E(i)/x3
!         a = x1/2 + x2*(0.5 + (1/pi)*atan((pi/3)*(x2/x4)*(lite - (lite**(-2.0)))))/2
!      end if
! Special fit
!      if (fittype .EQ. 3) then
!         a = ((E(i) + E(i)**2 + E(i)**3)/((1/x2) + (1/x3)*E(i) + (1/x4)*E(i)**2 + (1/x5)*E(i)**3))/2
!      end if
! YJ

! NOT FITTED
! CHECK TABULATION
      call imfptabs(Z,E(i),imfpvaltab)
      if (natoms .NE. natomstot) then
         imfpvaltab = -1.0
      end if

   imfpdone = .false.

! FOR ELF INFILE

! YJ
!      hbar = 1.05457E-34
!      me = 9.109E-31
!      e = 1.6022E-19
      hbar_yj = 1.054571726_db
      m_yj = 9.10938291_db
      e_yj = 1.602176565_db
      hme_yj = hbar_yj / sqrt( e_yj * m_yj )  

         a = 0.0_db
         convvalue = 0._db
         imfpvalue = 0._db

      if (noimfp) then
         a = 0._db
         imfpdone = .true.
      elseif (elf_inp .AND. E(i) .LE. scelfimfp(scelfimfpdim,1)) then
         do k=1,scelfimfpdim
            Econv(k) = scelfimfp(k,1)
            imfpval(k) = scelfimfp(k,2)
         end do
         do k=1,scelfimfpdim
!            convval(k) = (1.05457E-34/(imfpval(k)*1E-10))*(((2*Econv(k)*1.60218E-19)/9.10938E-31)**0.5)/1.60218E-19
            convval(k) = 10 * hme_yj * sqrt( 2 * Econv(k) ) / imfpval(k)
         end do
         econvmin = 0
         do k=1,scelfimfpdim
            if (Econv(k) .LE. E(i)) then
               econvmin = k
            end if
         end do
         if (E(i) .LE. 0.0) then
            convvalue = 0.0
         else if (econvmin .EQ. 0) then
            convvalue = (E(i)/Econv(1))*convval(1)
         else if (econvmin .EQ. linesconv) then
            convvalue = convval(linesconv)
         else
            convvalue = ((E(i)-Econv(econvmin))/(Econv(econvmin+1)-Econv(econvmin)))
            convvalue = convvalue*(convval(econvmin+1)-convval(econvmin))
            convvalue = convvalue + convval(econvmin)
         end if
         a = convvalue/2.0
         imfpdone = .true.
      elseif (imfp_inp) then
! FOR IMFP INFILE
         open(unit=152,file=trim(adjustl(imfp_infile)))
         linesconv = 0
         do k=1,2000
            read(152,*,end=50) Econv(k), imfpval(k)
            linesconv = linesconv + 1
         end do
         50 close(152)
         do k=1,linesconv
 !           convval(k) = (1.05457E-34/(imfpval(k)*1E-10))*(((2*Econv(k)*1.60218E-19)/9.10938E-31)**0.5)/1.60218E-19
            convval(k) = 10 * hme_yj * sqrt( 2 * Econv(k) ) / imfpval(k)
         end do
         econvmin = 0
         do k=1,linesconv
            if (Econv(k) .LE. E(i)) then
               econvmin = k
            end if
         end do
         if (E(i) .LE. 0.0) then
            convvalue = 0.0
         else if (econvmin .EQ. 0) then
            imfpb = ((2*convval(1))/Econv(1)) - (convval(2)-convval(1))/(Econv(2)-Econv(1))
            imfpm = (-2.0/Econv(1))*((convval(2)-convval(1))/(Econv(2)-Econv(1)) - (convval(1)/Econv(1)))
            if (imfpm .GT. 0) then
               convvalue = -1.0*(imfpm*E(i)**2)/2.0 + imfpb*E(i)
            else
               convvalue = -1.0
            end if
         else if (econvmin .EQ. linesconv) then
            convvalue = convval(linesconv)
         else
            convvalue = ((E(i)-Econv(econvmin))/(Econv(econvmin+1)-Econv(econvmin)))
            convvalue = convvalue*(convval(econvmin+1)-convval(econvmin))
            convvalue = convvalue + convval(econvmin)
         end if
         a = convvalue/2.0
         if (E(i) .LE. Econv(linesconv) .AND. convvalue .GT. 0.0) then
            imfpdone = .true.
         end if
      end if
! For no input IMFP and tabulated
      if (imfpvaltab .GT. 0.0 .AND. .NOT. imfpdone) then
!         convvalue = (1.05457E-34/(imfpvaltab*1E-10))*(((2*E(i)*1.60218E-19)/9.10938E-31)**0.5)/1.60218E-19
            convvalue = 10 * hme_yj * sqrt( 2 * E(i) ) / imfpvaltab
         a = convvalue/2.0
! For no input IMFP and non-tabulated
      elseif (.NOT. imfpdone) then
         voltemp = vol*natomstot
         Nvtemp = Nv/natoms
         masstotaltemp = masstotal/Navag
         voltemp = voltemp*1.0E+6
         rho = masstotaltemp/voltemp
         masstot = masstotal/natoms
         egap = 3.5
         if (rho .GT. 7.0 .AND. molinp) then
            rho = 7.0
         end if
         if (E(i) .GE. 50.0) then
            imfpvalue = tpp2m(E(i), Nvtemp, rho, masstot, egap)
!            convvalue = (1.05457E-34/(imfpvalue*1E-10))*(((2*E(i)*1.60218E-19)/9.10938E-31)**0.5)/1.60218E-19
            convvalue = 10 * hme_yj * sqrt( 2 * E(i) ) / imfpvalue
         elseif (E(i) .GT. 0.0) then
            rscratch = 50.0
            imfpvalue = tpp2m(rscratch, Nvtemp, rho, masstot, egap)
 !           convvalue = (1.05457E-34/(imfpvalue*1E-10))*(((2*rscratch*1.60218E-19)/9.10938E-31)**0.5)/1.60218E-19
            convvalue = 10 * hme_yj * sqrt( 2 * rscratch ) / imfpvalue
            convvalue = convvalue * E(i) / rscratch
         else
            convvalue = 0._db
         end if
         a = convvalue / 2
     end if

! YJ : not defined when E <= 0
      if( abs( convvalue ) > 1.e-20_db ) &
!         imfpvalue = (1.05457E-34/(convvalue*1E-10))*(((2*E(i)*1.60218E-19)/9.10938E-31)**0.5)/1.60218E-19
            imfpvalue = 10 * hme_yj * sqrt( 2 * E(i) ) / convvalue

! Once width is settled.. do convolution
      mu(i) = 0
      do k=-800, 800
         if( abs(a) > 1.e-100_db ) then 
           mult(k) = (atan(((2*(k)+1)*spacing/2)/a)-atan(((2*(k)-1)*spacing/2)/a))/pi
         else
           mult(k) = 0._db
         endif
         if (i+k .GT. 1 .AND. i+k .LT. maxpoint) then
            mu(i) = mu(i) + mu1(i+k)*mult(k)
         else if (i+k == 1) then
            mu(i) = mu(i) + mu1(i+k)*(atan(((2*(k)+1)*spacing/2)/a) + pi/2)/pi
         else if (i+k == maxpoint) then
            mu(i) = mu(i) + mu1(i+k)*(pi/2 - atan(((2*(k)-1)*spacing/2)/a))/pi
         end if
     end do

! Remove old atomic BG
      mu(i) = (mu(i)-atom(i))/atom(i)

! Dampen oscillations
      if (E(i) .GT. 0) then
         mu(i) = mu(i)*eu**(-2*(sigmaparam**2)*((2*pi/6.626E-34)*1E-5*(2*9.109E-31*E(i)*1E10*1.602E-19)**0.5)**2)
!         mu(i) = mu(i) * exp( -2 * 2 * E(i) * ( 1.E+09_db * sigmaparam / hme_yj )**2 )
      end if

! Insert new atomic BG with spline
      mu(i) = (1+mu(i))*spline(i)

! Add background from other edges (FFAST)
      background(i) = 0
      bgpart = 0
      if (bgedges) then
         ffastbg = 0
         do iii=1,92
            if (atomtypes(iii,2) .NE. 0) then
               if (atomtypes(iii,2) .EQ. Z) then
                  inckedge = .false.
               else
                  inckedge = .true.
               end if
               call ffast(atomtypes(iii,2),(E(i)/1000)+edgepos,inckedge,ffastbg)
               bgpart = ffastbg*cm2gtombarn(iii)
               background(i) = background(i) + bgpart             
            end if
         end do
         mu(i) = mu(i) + background(i)
         atom(i) = atom(i) + background(i)
      end if

! Convert to cm2g (if needed)
      if (cm2g) then
         mbarntocm2g = (1.0E-18)/(masstotal/Navag)
         mu(i) = mu(i)*mbarntocm2g
         atom(i) = atom(i)*mbarntocm2g
         background(i) = background(i)*mbarntocm2g
      end if

! Convert energy
      if (Energphot) then
         E(i) = E(i) + edgepos*1000
      end if

! Write main outputs
      if (cm2g) then
         write(*,902) E(i), mu(i), mu0(i)*mbarntocm2g, atom(i), background(i), imfpvalue!, a*2
         write(103,902) E(i), mu(i), mu0(i)*mbarntocm2g, atom(i), background(i), imfpvalue!, a*2
      else
         write(*,901) E(i), mu(i), atom(i), background(i), imfpvalue!, a*2
         write(103,901) E(i), mu(i), atom(i), background(i), imfpvalue!, a*2
      end if
   end do
end do
close(103)
901 format(f10.3,E15.7,E15.7,E15.7,F10.3)
902 format(f10.3,E15.7,E15.7,E15.7,E15.7,F10.3)
end

! Function for estimate of compound IMFPs from TPP-2M Equation
real function tpp2m(Enin, Nv, rho, masstot, egap)
   real Nv, rho, masstot, egap, epparam, Enin
   real betparam, gamparam, cparam, dparam, uparam
   epparam = (829.4*(Nv*rho/masstot))**0.5
   betparam = -0.10 + 0.944/((epparam**2 + egap**2)**0.5) + 0.069*rho**0.1
   gamparam = 0.191*rho**(-0.5)
   uparam = Nv*rho/masstot
   cparam = 1.97 - 0.91*uparam
   dparam = 53.4 - 20.8*uparam
   tpp2m = Enin/(epparam**2*(betparam*LOG(gamparam*Enin) - (cparam/Enin) + (dparam/(Enin**2))))
return
end

! Function for determination of Debye-Waller Factor sigma
      real function sigmax(x, y, z, th, T, am, vol)
      real x, y, z, r, m, w, q, T, D(49), con, F
      real hbar, kb, scratch, vol, pi, am, Na, th
      integer j
      hbar = 1.0545717E-34
      kb = 1.3806488E-23
      pi = 3.1415927
      Na = 6.0221413E23
!  Calculate Dn parameters
      do i=1,17
         D(i*2-1) = Dn(i*2-1,th,T)
      end do
!  Mass of one atom (kg)
      m = am/(Na*1000)
!  Debye Frequency
      w = th*kb/hbar
!  Debye Wave Vector
      q = (6*pi**2/vol)**(1.0/3.0)
!  Get distance from absorber
      r = (x**2+y**2+z**2)**0.5
!  Get Debye-Waller factor sigma^2
      if (r .EQ. 0) then
      sigmax = 0
      return
      else
      con = 6*hbar
      scratch = m*w
      con = con/scratch
      sigmax = con*(0.25+D(1)*(T/th)**2)-con*((1-cos(q*r))/(2*(q*r)**2))
      do 30 i = 1, 33, 2
      j = (i+1)/2
      k = i-1
      sigmax = sigmax+(((((T/th)**2)*((q*r*(T/th))**k))/F(i))*(-1)**j)*con*D(i)
30    continue
      return
      endif
      end
!
      real function F(i)
      integer i, v
      v = i
      F = 1
      do 40 v = i, 1, -1
      F = F*v
40    continue
      end
!
      real function Dn(n,th,Tin)

      integer, parameter:: db = selected_real_kind(15)
      
 	  integer n, p, ap, aap
	  real(kind=db) e, Z, h, x, first, second, third, fourth, ans
          real Trat, Tin, th
	  p = 1000000
	  Trat = th/Tin
	  Z = 0.0000001
	  e = 2.7182818
	  h = (Trat-Z)/p
	  ap = p/2-1
	  aap = p/2
	  first = (Z**n)/(e**Z-1)
	  second = 0
	  third = 0
	  fourth = 0
	  do 10 i = 1, ap
	  x = Z+(2*i*((Trat-Z)/p))
	  second = second + (x**n)/(e**x-1)
10    continue
      second = second*2
	  do 20 i = 1, aap
	  x = Z+((2*i-1)*((Trat-Z)/p))
	  third = third + (x**n)/(e**x-1)
20    continue
      third = third*4
	  fourth = (Trat**n)/(e**Trat-1)
	  ans = (h*(first+second+third+fourth))/3
      Dn = ans
      end


! Self-consistent model for electron ELF using dynamic-width Mermin functions
subroutine scelf(elf_infile,mermrank,scelfimfp,inpname,Efermi)

  integer, parameter:: db = selected_real_kind(15)

real ( kind = db ) elf0(0:25000), win(0:25000), Ni
real ( kind = db ) e, c, alpha, beta, Ai, sp, a0
real ( kind = db ) elf(1300), pi, hbar, me, wq
real ( kind = db ) wi(1300), q(0:100), wiout2(130)
real ( kind = db ) elfmag(1300), elfout(1300), elfout2(130)
real ( kind = db ) bestelf(0:1300,0:80), bestelf2(0:120,0:80)
real ( kind = db ) merminwidths(0:1300,0:80), mw, widthint
real ( kind = db ) w, k2, w0, elfpart, kfact, wqo, groupv
real ( kind = db ) vferm, wisi, eps0, quadbit, quartbit
real ( kind = db ) alphavos, wq1, scelfimfp(1024,2), maxelfen
real Efermi
complex ( kind = db ) eps
character(len=1024) inpname, outname
character(len=132) elf_infile
integer i, j, wiint, qint, lines, jmax
integer cycs, disptype, broaden
eps0 = 8.85418782E-12
pi = 3.14159265
hbar = 1.05457148E-34
me = 9.109E-31
e = 1.6022E-19
c = 2.9979E+08
a0 = 52.9177E-02
sp = 0.1
win(0) = 0
elf0(0) = 0
mermrank = mermrank + 1

! DEFINE DISPERSION TYPE (0: Partial Pole 1: Lindhard/Mermin, 2: Quadratic, 3: Quartic)
disptype = 1

! ALPHA PARAMETER
alphavos = 1.0

! SET NUMBER OF MERMIN CYCLES
if (mermrank .GE. 2) then
   cycs = mermrank - 1
else
   cycs = 0
   disptype = 0
endif

! Announce status
   if (cycs .EQ. 0) then
      write(*,*) 'Calculting generalized ELF using a Lindhard representation'
   else
      write(*,*) 'Calculating generalized ELF using a Mermin representation (', mermrank-1, ')'
   end if

! Read in optical ELF
open(unit=102,file=trim(adjustl(elf_infile)))
lines = 0
do i=1,25000
   read(102,*,end=10) win(i), elf0(i)
   lines = lines + 1
end do
10 close(102)
maxelfen = win(lines)
do i=lines+1,250
   win(i) = 2*win(i-1) - win(i-2)
   elf0(i) = 0.0
end do

! Set up optical ELF on fine grid
do i=1,1230
   wi(i) = i*sp
   jmax=0
   do j=1,lines
      if (win(j) .LT. wi(i)) then
         jmax = j
      end if
   end do
   elf(i) = elf0(jmax) + (elf0(jmax+1) - elf0(jmax))*(wi(i) - win(jmax))/(win(jmax+1) - win(jmax))
end do

! Create output file
write(outname,*) inpname(1:len(trim(inpname))-4), "_ELF.txt"
open(unit=101,file=trim(adjustl(outname)))

! Set up momenta
do j=0,80
   q(j) = j*0.15369296
end do
qint = 0

! Make q-dependent ELFs for initial estimate
do qint = 1,80
   do ii=1,1230
      elfout(ii) = 0.0
   end do
   do i=1,1200 ! For i GT 1200, expand wqlookup.f90
      wiint = i

! Establish wq, wq - wi (DISPERSION RELATION)
      call wqlookup(wiint,qint,wq)
      if (disptype .EQ. 2) then
! Quadratic
         wq = wi(wiint) + ((q(qint)*1E+10)**2)*(hbar**2/(2*me))/e
      elseif (disptype .EQ. 3) then
! Quartic
         wisi = wi(wiint)*e/hbar
         vferm = hbar/me
         vferm = vferm*(3*pi**2*wisi)**(1.0/3.0)
         vferm = vferm*(me/e)**(1.0/3.0)
         vferm = vferm*(eps0/e)**(1.0/3.0)
         vferm = vferm*(wisi)**(1.0/3.0)
         quadbit = ((q(qint)*1E+10)**2)*(hbar**2/(2*me))/e
         wq = wi(wiint)**2
         wq = wq + quadbit**2
         quartbit = ((q(qint)*1E+10)**2)*(vferm**2)*(hbar**2/3)/(e**2)
         wq = wq + quartbit
         wq = wq**0.5
      end if

! Insert Alpha parameter
      wq = alphavos*wq + (1-alphavos)*wi(wiint)

! Define Trivial alpha and beta
      alpha = 0.001
      beta = 0.001
      Ai = wi(i)*0.1*elf(i)
      Ni = Ai/wq
      elfmag(i) = Ni/(alpha + beta)

! Build Initial ELF Estimate
      do ii=1,1230
         if (wi(ii)+0.05 .LT. wq+beta .AND. wi(ii)-0.05 .GE. wq-alpha) then
            elfout(ii) = elfout(ii) + elfmag(i) ! rectangle covers entire wi(ii) point
         elseif (wi(ii)+0.05 .GE. wq+beta .AND. wi(ii)-0.05 .LE. wq-alpha) then
            elfout(ii) = elfout(ii) + elfmag(i)*(alpha+beta)/(sp) ! rectangle entirely within wi(ii)
         elseif (wi(ii)+0.05 .GE. wq+beta .AND. wi(ii)-0.05 .GT. wq-alpha) then
            if (wq+beta .GT. wi(ii)-0.05) then ! rectangle hangs to LHS
               elfout(ii) = elfout(ii) + elfmag(i)*((wq+beta) - (wi(ii)-0.05))/(sp)
            end if
         elseif (wi(ii)+0.05 .LT. wq+beta .AND. wi(ii)-0.05 .LT. wq-alpha) then
            if (wq-alpha .LT. wi(ii)+0.05) then ! rectangle hangs to RHS
               elfout(ii) = elfout(ii) + elfmag(i)*((wi(ii)+0.05) - (wq-alpha))/(sp)
            end if
         end if
      end do
   end do

! Put current ELF into BESTELF array
   bestelf(0,qint) = 0.0
   do iii=1,1230
      bestelf(iii,qint) = elfout(iii)
   end do
end do
! END OF GENERATION OF FIRST ELF ESTIMATE
write(*,*) "Lindhard ELF built"

! *************************!!!*******************************************************
broaden = 1
if (cycs .EQ. 0) then
   cycs = 1
   broaden = 0
end if
do jjj=1,cycs
! EXIT for calc of ELF ONLY
   if (disptype .EQ. 0) EXIT
! Find array of Mermin widths
! For each plasmon resonance
   write(*,*) 'Calculating excitation widths ...'
   do qint=1,80
         merminwidths(0,qint) = 0.2
      do ij=1,120
         ii = ij*10
! Start with 0 width; Find wq, relative energy/momentum ratio, wqo (for group velocity)
         widthint = 0.0
         call wqlookup(ii,qint,wq)
         kfact = (qint**2)/wq
         if (qint .EQ. 1) then
            wqo = ii*sp
         else
            call wqlookup(ii,qint-1,wqo)            
         endif
         if (qint .EQ. 80) then
            wq1 = wq + (wq - wqo)
         else
            call wqlookup(ii,qint+1,wq1)
         end if
! Integrate to find losses for finite-momentum plasmon
         do iii=1,1200
            do j=1,80
               if ((iii*sp) .LE. wq) then
                  if (j .LE. ((kfact*wq)**0.5 + (kfact*(wq - iii*sp))**0.5)) then
                     if (j .GE. ((kfact*wq)**0.5 - (kfact*(wq - iii*sp))**0.5)) then
                        widthint = widthint + (bestelf(iii,j)*sp)/(j*1.0)
                     endif
                  endif
               endif
            end do
         end do
! Avoid problem for zero integral (infinite IMFP)
         if (widthint .EQ. 0.0) then
            widthint = 1.0E-12
         endif
! Convert loss total into effective IMFP (angstroms)
         merminwidths(ii,qint) = (a0*pi*wq)/widthint

         if (disptype .EQ. 2) then
! Quadratic
            groupv = alphavos*(q(qint)*1E+10)*(hbar/me)
         elseif (disptype .EQ. 3) then
! Quartic
            wisi = ij*e/hbar
            vferm = hbar/me
            vferm = vferm*(3*pi**2*wisi)**(1.0/3.0)
            vferm = vferm*(me/e)**(1.0/3.0)
            vferm = vferm*(eps0/e)**(1.0/3.0)
            vferm = vferm*(wisi)**(1.0/3.0)
            groupv = ((q(qint)*1E+10)**3)*(hbar**3/(me**2))
            groupv = groupv + (2*(q(qint)*1E+10)*hbar)*(vferm**2)/3
            groupv = groupv/(2*wq*e)
         else
            groupv = (1.0E-10)*e*((wq-wqo)+(wq1-wq))/(2*hbar*0.15369296)
         end if
         groupv = groupv*alphavos
         merminwidths(ii,qint) = (merminwidths(ii,qint))*1.0E-10/groupv
         merminwidths(ii,qint) = (hbar/merminwidths(ii,qint))/e
! set minimum width
         if (merminwidths(ii,qint) .LT. 0.2) then
            merminwidths(ii,qint) = 0.2
         endif
      end do
      do ii=1201,1300
         merminwidths(ii,qint) = 0.2
      end do
      if (qint .EQ. 20) then
         write(*,*) 'Widths 25 % calculated'
      elseif (qint .EQ. 40) then
         write(*,*) 'Widths 50 % calculated'
      elseif (qint .EQ. 60) then
         write(*,*) 'Widths 75 % calculated'
      end if
   end do

! Interpolate to obtain widths for every 0.1 eV
   do qint=1,80
      do i=0,119
         do j=1,9
            merminwidths(i*10+j,qint) = merminwidths(i*10,qint) + (j*sp)*(merminwidths((i+1)*10,qint) - merminwidths(i*10,qint))
         end do
      end do
   end do
   if (broaden .NE. 1) EXIT

! ********************************************************************************
   write(*,*) "Now building Mermin ELF", jjj

! Build second guess of ELF
! For each momentum transfer ...
   do qint=1,80
      k2 = (qint*0.3)**2
! ... and each energy
      do i=1,1230
         w = i*sp
! Reset bestelf
         bestelf(i,qint) = 0.0
! Then add all the Mermin components
         do ii=1,1200
            w0 = ii*sp
            mw = merminwidths(ii,qint)
            call mermelf(w, k2, w0, mw, eps, elfpart)
            bestelf(i,qint) = bestelf(i,qint) + elfpart*(2/pi)*(1/w0)*sp*elf(ii)
         end do
      end do
      if (qint .EQ. 20) then
         write(*,*) 'Mermin ELF 25 % built'
      elseif (qint .EQ. 40) then
         write(*,*) 'Mermin ELF 50 % built'
      elseif (qint .EQ. 60) then
         write(*,*) 'Mermin ELF 75 % built'
      end if
   end do
end do

! **************************!!!!**************************************************
! Convert ELF to 1 eV spacing
do qint=1,80
   do iii=1,121
      wiout2(iii) = iii*1.0
      elfout2(iii) = 0.0
       do jjj=1,9
          elfout2(iii) = elfout2(iii) + bestelf(iii*10-5+jjj,qint)*sp
       end do
       do jjj=1,2
          elfout2(iii) = elfout2(iii) + bestelf(iii*10-15+10*jjj,qint)*sp*0.5
       end do

!!! Correction YJ 2019/09/27 because dimension bestelf2(0:120) 
!!!!      bestelf2(iii,qint) = elfout2(iii)
     if( iii <= 120 ) bestelf2(iii,qint) = elfout2(iii)
!!!! End correction

   end do
end do

! Write final output
do i=1,123
   if (wi(i*10) .LE. maxelfen) then
      write(101,*) REAL(wi(i*10)), 0.000000, REAL(elf(i*10))
   end if
end do
do qint=1,80
   do iii=1,120
      if (wiout2(iii) .LE. maxelfen) then
         write(101,*) REAL(wiout2(iii)), REAL(q(qint)), REAL(bestelf2(iii,qint))
      end if
   end do
end do
close(101)
call elftoimfp(outname,scelfimfp,Efermi)
end

subroutine lindelf(w, k2, wq, gamma, eps, elf)

  integer, parameter:: db = selected_real_kind(15)

real ( kind = db ) hbar, e, me, wsi
real ( kind = db ) pi, wq, gamma, w, elf, wqsi
real ( kind = db ) eps0, k2, vfsi, kf, ksi, gamsi
!real*16 efev, temp1
complex ( kind = db ) iota, u, z, f1, f2, eps
pi = 3.14159265
hbar = 1.05457148E-34
me = 9.10938188E-31
e = 1.60217646E-19
eps0 = 8.85418782E-12
iota = SQRT(CMPLX(-1.0))
gamsi = gamma*e/hbar
wqsi = wq*e/hbar
wsi = w*e/hbar
vfsi = hbar/me
vfsi = vfsi*(3*pi**2*wqsi)**(1.0/3.0)
vfsi = vfsi*(me/e)**(1.0/3.0)
vfsi = vfsi*(eps0/e)**(1.0/3.0)
vfsi = vfsi*(wqsi)**(1.0/3.0)
kf = me*vfsi/hbar
ksi = (SQRT(k2*e)*SQRT(me*2.0))/hbar
u = (wsi+iota*gamsi)/(vfsi*ksi)
z = ksi/(2.0*kf)
f1 = 0.5 + (1/(8*z))*(1-(z-u)**2)*ZLOG((z-u+1)/(z-u-1))
f2 = (1/(8*z))*(1-(z+u)**2)*ZLOG((z+u+1)/(z+u-1))
eps = 1 + ((3*wqsi**2)/(ksi**2*vfsi**2))*(f1+f2)
elf = AIMAG(eps)/(REAL(eps)**2+AIMAG(eps)**2)
end

subroutine mermelf(w, k2, wq, gamma, eps, elf)

  integer, parameter:: db = selected_real_kind(15)

real ( kind = db ) w, k2, wq, gamma, elf, scratch
real ( kind = db ) w2, gamma2
complex ( kind = db ) eps1, eps2, eps, iota

iota = SQRT(CMPLX(-1.0))
w2 = 1.0E-08
gamma2 = 1.0E-08
call lindelf(w, k2, wq, gamma, eps1, scratch)
call lindelf(w2, k2, wq, gamma2, eps2, scratch)
eps = (1+iota*(gamma/w))*(eps1-1)
eps = eps/(1+(iota*(gamma/w))*((eps1-1)/(eps2-1)))
eps = eps + 1.0
elf = AIMAG(eps)/(REAL(eps)**2+AIMAG(eps)**2)
end

subroutine switchelf(lindmerm, w, k2, wq, gamma, eps, elf)

  integer, parameter:: db = selected_real_kind(15)

integer lindmerm
real ( kind = db ) w, k2, wq, gamma, elf
complex ( kind = db ) eps

if (lindmerm .EQ. 1) then
   call lindelf(w, k2, wq, gamma, eps, elf)
else
   call mermelf(w, k2, wq, gamma, eps, elf)
endif
end

! Integration program for converting a full ELF to an IMFP
subroutine elftoimfp(inpname,scelfimfp,Efermi)

  integer, parameter:: db = selected_real_kind(15)

real ( kind = db ) scelfimfp(1024,2)
real win(500), qin(500), elfin(500,500), scratch1, scratch2
real wfine(4000), qfine(4000), elffine(4000,4000)
real qfineev(4000), qev, wmax1, wmax2
real qspace, wspace, sum, wfinespace, qfinespace
real a0, pi, sumpart, imfp, q, w, elf, ef
real hbar, me, e, elflowq, elfhighq, qfinespaceev
real wth, Efermi
character(len=1024) inpname
integer lines, wpos, qpos, wins, qins
integer wlow, qlow

! Fermi correction
ef = ((Efermi)**2)**0.5

! Threshold
wth = 0.0

hbar = 1.05457E-34
me = 9.109E-31
e = 1.6022E-19
a0 = 52.9177E-02
pi = 3.14159
scratch1 = 0.0
scratch2 = 0.0
lines = 0
wfinespace = 0.04
qfinespace = 0.01
qspace = 0.20
wspace = 1.0
wpos = 0
qpos = 0
wins = 0
qins = 0

! READ IN ELFIN
open(unit=101,file=trim(adjustl(inpname)))
lines = 0
do i=1,25000
   read(101,*,end=10) w, q, elf
   if (i .EQ. 1) then
      qpos = 1
      wpos = 1
   elseif (q .NE. qin(qpos)) then
      qpos = qpos + 1
      wpos = 1
   end if
   if (wpos .GT. wins .AND. qpos .GT. 1) then
      wins = wpos
   end if
   if (qpos .GT. qins) then
      qins = qpos
   end if
   win(wpos) = w
   qin(qpos) = q
   elfin(wpos,qpos) = elf
   wpos = wpos + 1
   lines = lines + 1
end do
10 close(101)

do i=1,INT(win(wins)/wfinespace)
   wfine(i) = i*wfinespace
end do
do i=1,INT(qin(qins)/qfinespace)
   qfine(i) = i*qfinespace
end do

! Announce status
write(*,*) 'Calculating IMFPs...'

! FIND ELFFINE(i,j)
do i=1,INT(win(wins)/wfinespace)
   do j=1,INT(qin(qins)/qfinespace)
      elflowq = 0.0
      elfhighq = 0.0
      wlow = 0
      qlow = 0
      do m=1,wins
         if (win(m) .LE. wfine(i)) then
            wlow = m
         end if
      end do
      do m=1,qins
         if (qin(m) .LE. qfine(j)) then
            qlow = m
         end if
      end do
      if (wlow .EQ. 0) then
         elflowq = elfin(1,qlow)*wfine(i)
         elfhighq = elfin(1,qlow+1)*wfine(i)
      else
         elflowq = elfin(wlow,qlow) + (elfin(wlow+1,qlow)-elfin(wlow,qlow))*(wfine(i)-win(wlow))/(win(wlow+1)-win(wlow))
         elfhighq = elfin(wlow,qlow+1) + (elfin(wlow+1,qlow+1)-elfin(wlow,qlow+1))*(wfine(i)-win(wlow))/(win(wlow+1)-win(wlow))
      end if
         elffine(i,j) = elflowq + (elfhighq - elflowq)*(qfine(j)-qin(qlow))/(qin(qlow+1)-qin(qlow))

      if (wfine(i) .LT. wth) then
         elffine(i,j) = 0.0
      end if
   end do
end do

! INTEGRATE AND FIND IMFP
do k=1,120
   sum = 0.0
   wmax2 = k*1.0
   wmax1 = wmax2 + ef

   do j=1,INT(win(wins)/wfinespace)
      sumpart = 0.0
      w = wfine(j)
      do i=1,INT(qin(qins)/qfinespace)
         q = qfine(i)
         qev = qfineev(i)

! QFINESPACE UNITS
            qfinespaceev = qfine(2) - qfine(1)

! ADD ALL RELEVENT PARTS
         if (i .EQ. INT(qin(qins)/qfinespace)) then
            if (q*1.0E+10 .LE. ((SQRT(2*me)/hbar)*SQRT(wmax1*e) + (SQRT(2*me)/hbar)*SQRT(e*(wmax1-w)))) then
               write(*,*) 'INSUFFICIENT Q RANGE FOR THIS ENERGY'
            end if
         end if
         if (q*1.0E+10 .GE. ((SQRT(2*me)/hbar)*SQRT(wmax1*e) - (SQRT(2*me)/hbar)*SQRT(e*(wmax1-w)))) then
            if (q*1.0E+10 .LE. ((SQRT(2*me)/hbar)*SQRT(wmax1*e) + (SQRT(2*me)/hbar)*SQRT(e*(wmax1-w))))  then
               if (w .LE. wmax2 .AND. w .LE. 1000.0*wmax1/2.0) then
               sum = sum + elffine(j,i)*wfinespace*qfinespace/q
               sumpart = sumpart + elffine(j,i)*wfinespace*qfinespace/q
               end if
            end if
         end if
      end do
   end do

   sum = sum/(a0*pi*wmax1)
   imfp = 1/sum

   if (wmax2 .GT. 0.0) then
      if (wmax2 .LE. win(wins)) then
         scelfimfp(k,1) = wmax2
         scelfimfp(k,2) = imfp
      end if
   end if
end do
end

