subroutine ffast(Z,E,kedge,val)

  implicit none
  
  integer, parameter:: nam = 92

  integer:: i, nlow, np_dim, Z
  integer, dimension(nam):: np 

  logical:: kedge

  real:: b, E, val, val1, val2
  real, dimension(:), allocatable:: ffastdat_1, ffastdat_2, ffastdat_3

  data np / 165, 165, 170, 169, 175, 175, 175, 175, 175, 175, &
            173, 174, 180, 185, 188, 189, 190, 189, 189, 189, &
            190, 190, 189, 189, 199, 190, 190, 189, 187, 555, &
            559, 561, 561, 558, 564, 559, 205, 214, 215, 214, &
            214, 210, 224, 214, 639, 222, 220, 220, 220, 219, &
            219, 218, 215, 217, 244, 241, 234, 239, 234, 893, &
            892, 897, 893, 902, 903, 898, 893, 899, 899, 899, &
            900, 910, 909, 914, 766, 765, 769, 767, 768, 767, &
            771, 778, 775, 774, 778, 773, 775, 761, 777, 280, &
            277, 277/

   
  if( Z > nam ) then
    write(6,110) Z, nam
    stop
  endif

  np_dim = np(Z)
  allocate( ffastdat_1(np_dim) )
  allocate( ffastdat_2(np_dim) )
  allocate( ffastdat_3(np_dim) )
   
  call fastdat( ffastdat_1, ffastdat_2, ffastdat_3, np_dim, Z )
     
  do i = 1,np_dim - 1
    if( ffastdat_1(i) <= E ) nlow = i
    if( ffastdat_1(i) > E ) exit
  end do
   
  if( kedge ) then
    val1 = ffastdat_2(nlow)
    val2 = ffastdat_2(nlow+1)
  else
    val1 = ffastdat_2(nlow) - ffastdat_3(nlow)
    val2 = ffastdat_2(nlow+1) - ffastdat_3(nlow+1)
  end if
   
  b = LOG( val2 / val1 ) / LOG( ffastdat_1(nlow+1) / ffastdat_1(nlow) )
  val = val1 * ( E / ffastdat_1(nlow) )**b
   
  deallocate( ffastdat_1, ffastdat_2, ffastdat_3 )
    
  return
  110 format(//' Problem in ffast routine :'// &
                '   Z =',i5,' > nam = ',i3) 
end

